Principais Parcerias: 
a) Agência Brasileira de Cooperação - ABC;
b) Ministério das Relações Exteriores - MRE;
c) Centro Latino-Americano de Administração para o Desenvolvimento - CLAD;
d) Escola Ibero-Americana de Administração e Políticas Públicas - EIAPP;
e) União Europeia - UE;
f) Organização para a Cooperação e o Desenvolvimento Econômico - OCDE;
g) Instituto Internacional de Ciências Administrativas - IIAS;
h) Outros.

